import { useEffect, useState } from "react";
import axios from "axios";

export default function Home() {
  const [clientes, setClientes] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8000/api/clientes/")
      .then(res => setClientes(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div className="flex h-screen">
      {/* Menú lateral */}
      <div className="w-1/7 bg-gray-800 text-white p-4">
        <h1 className="text-xl font-bold mb-6">HAWKEYE</h1>
        <div className="space-y-4">
          <div className="bg-gray-700 p-2 rounded hover:bg-gray-600 cursor-pointer flex justify-between">
            <span>Clientes</span>
            <span>➤</span>
          </div>
          <div className="bg-gray-700 p-2 rounded hover:bg-gray-600 cursor-pointer flex justify-between">
            <span>Propiedades</span>
            <span>➤</span>
          </div>
        </div>
      </div>

      {/* Contenido */}
      <div className="w-5/6 p-6 space-y-4">
        <div className="bg-white p-4 shadow rounded">
          <h2 className="text-xl font-bold mb-2">Lista de Clientes</h2>
          <ul>
            {clientes.map(cliente => (
              <li key={cliente.id} className="border-b py-1">
                {cliente.nombre} - {cliente.email}
              </li>
            ))}
          </ul>
        </div>
        <div className="bg-white p-4 shadow rounded">Contenedor 2</div>
        <div className="bg-white p-4 shadow rounded">Contenedor 3</div>
      </div>
    </div>
  );
}
